import "./about.scss";
import { Product } from "../../../App";
export const AboutView = (product: any) => {
    const { id, name, color, year, pantone_value } = product.product as Product;

    return (
        <>
            <div className="about-view">
                <p>id : {id}</p>
                <p>{name}</p>
                <p>{color}</p>
                <p>{year}</p>
                <p>{pantone_value}</p>
            </div>
        </>
    );
};
